import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
import { jsonData } from "./"
const data = [
  {    
    "id": 1,    
    "gender": "Female",    
    "first_name": "Helen",
    "last_name": "Nguyen",
    "email": "hnguyen0@bloomberg.com",
    "ip_address": "227.211.25.18"
  }, 
  {
    "id": 2,
    "gender": "Male",
    "first_name": "Carlos",
    "last_name": "Fowler",
    "email": "cfowler1@gnu.org",
    "ip_address": "214.248.201.11"
  }];

  function loops(){ 

    data.forEach(element => {
      alert("Name: " + element.first_name + ", " + element.last_name);
      alert("Email: " + element.email);
    });
  }

const itse = ["id", 2, 3, 4, 5];
const listItems = itse.map((string) => 
    <h1>{string}</h1>
)

var usersWithName = Object.keys(data).map(function(key) {
  var user = data[key];
  user.id = key;
  return user;
});

class App extends Component {

  render() {

    return (
      <div className="App">
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
          <p>
            Edit <code>src/App.js</code> and save to reload.
          </p>
          <div>{listItems}</div>
          <a
            className="App-link"
            href="https://reactjs.org"
            target="_blank"
            rel="noopener noreferrer"
          >
            Learn React
          </a>
        </header>
      </div>
    );
  }
}

export default App;
